import React from 'react';

function Product(props) {
    return
    (<div className='card'>
        <h2>{props.product.title}</h2>
        <img src={props.product.img} alt=''></img>
        <p>{props.product.description}</p>
        <p>{props.product.price}</p>
    </div>);
}
export default Product;
